const AGE_START_VALUE = 18;
const AGE_END_VALUE = 70;

const isikukoodGeneratorEl = document.querySelector( '.isikukood-generator' );
const isikukoodGeneratorGenderSelectEl = isikukoodGeneratorEl.querySelector( '.isikukood-generator__gender' );
const isikukoodGeneratorGenerateBtnEl = isikukoodGeneratorEl.querySelector( '.isikukood-generator__generate-btn' );
const isikukoodGeneratorResultEl = isikukoodGeneratorEl.querySelector( '.isikukood-generator__result' );
const isikukoodGeneratorAgeSelectEl = (function( startValue, endValue ) {
	const ageSelect = document.createElement( 'select' );
	ageSelect.id = 'age';
	ageSelect.className = 'isikukood-generator__age form-control custom-select';

	let ageValues = [];
	for ( let i = startValue; i <= endValue; i++ ) {
		ageValues.push( i );
	}

	for ( let i = 0; i < ageValues.length; i++ ) {
		let value = i + startValue;
		ageSelect[i] = new Option( value, value );
	}

	const ageGroupEl = isikukoodGeneratorEl.querySelector( '.isikukood-generator__age-group .select-container' );
	ageGroupEl.appendChild( ageSelect );

	return ageSelect;
})( AGE_START_VALUE, AGE_END_VALUE );

const randomDate = function( startDate, endDate ) {
    return new Date( startDate.getTime() + Math.random() * ( endDate.getTime() - startDate.getTime() ) );
}

const getIsikukoodGeneratorOptions = function() {
	let gender = isikukoodGeneratorGenderSelectEl.value;
	const age = parseInt( isikukoodGeneratorAgeSelectEl.value );
	const today = new Date();

	const startDate = new Date(
		today.getFullYear() - age - 1,
		today.getMonth(),
		today.getDate() + 1
	);
	const endDate = new Date(
		today.getFullYear() - age,
		today.getMonth(),
		today.getDate() - 1
	);
	const birthDate = randomDate( startDate, endDate );

	if ( gender === 'rnd' ) {
		genders = [ 'male', 'female' ];
		gender = genders[ Math.floor( Math.random() * genders.length ) ];
	}

	return {
		gender: gender,
		birthDay: birthDate.getDate(),
		birthMonth: birthDate.getMonth(),
		birthYear: birthDate.getFullYear()
	};
}

const setIsikukoodGenerationResult = function( isikukood ) {
	isikukoodGeneratorResultEl.textContent = isikukood;
}

const isikukoodGenerateBtnClickHandler = function() {
	const isikukoodGeneratorOptions = getIsikukoodGeneratorOptions();
	const isikukood = Isikukood.generate( isikukoodGeneratorOptions );
	setIsikukoodGenerationResult( isikukood );
};

isikukoodGeneratorGenerateBtnEl.addEventListener( 'click', function() {
	isikukoodGenerateBtnClickHandler();
} );

isikukoodGeneratorGenerateBtnEl.click();
